  false,\n\t\"url\": null,\n\t\"notes\": \"The 17,158 acre Johnson Valley project
  area is located in San Bernardino County, 32 miles east of Victorville, CA bisected
  by highway 247. The fine-scale vegetation map was created as part of a collaborative
  project between the United States Geological Survey (USGS) and the Vegetation Classification
  and Mapping Program of the California Department of Fish and Wildlife (CDFW) to
  show the correlation between vegetation and geomorphology. The vegetation mapping
  types are based on the vegetation classification that was developed for the larger
  Desert Renewable Energy Conservation Plan (DRECP) mapping project (CDFW 2013). The
  vegetation classification was developed using a compilation of data collected for
  several projects including Anza-Borrego Desert State Park and Environs (Keeler-Wolf
  et al. 1998), the Mojave Desert Ecosystem Programu2019s Vegetation Database (Thomas
  et al. 2004), Vegetation of Joshua Tree National Park (La Doux et al. 2013), and
  Vegetation Classification and Mapping at Lake Mead National Recreation Area, Mojave
  National Preserve and Death Valley National Park (in progress, draft as of 2014).\",\n\t\"license_title\":
